import './App.css';
import { TeamPage } from './Pages/TeamPage';
import { MatchPage } from './Pages/MatchPage';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'

function App() {
  return (
    <div className="App">

      <Router>
        <Switch>
          <Route path='/team/:teamName/matches'>
            <MatchPage />
          </Route>
          <Route path='/team/:teamName'>
            <TeamPage />
          </Route>
        </Switch>
      </Router>

    </div>
  );
}

export default App;
